import Login from "./components/Login/Login";
import {Route,Routes, browserrouter} from 'react-router-dom';
import Navbar from "./components/Navbar/Navbar";
import Home from "./components/Main/Home";
function App() {
  return (
    <div className="App">
        <Login/>
      <browserrouter>
      <Routes>
      <Navbar/>
       <Home/>
      </Routes>
      </browserrouter>
    </div>
  );
}

export default App;
